import React, { Component } from 'react';

class DailyHabitTracker extends Component {
    constructor(props) {
        super(props);
        this.state = { habits: null }
    }

    componentDidMount() {
        fetch('/habits')
            .then(res => res.json())
            .then(habits => this.setState({habits}));
    }

    render() { 
        const { habits } = this.state;
        const display = habits
            ? (
                <table>
                    <tbody>
                        <tr>
                            <th>Habit</th>
                            <th>Mon</th>
                            <th>Tue</th>
                            <th>Wed</th>
                            <th>Thu</th>
                            <th>Fri</th>
                            <th>Sat</th>
                            <th>Sun</th>
                        </tr>
                        {habits.map(habit => {
                            return (<tr>
                                <td>{habit}</td>
                            </tr>)
                        })}
                    </tbody>
                </table>
            )
            : <p>loading...</p>

        return (display);
    }
}

export default DailyHabitTracker;
